import { Injectable } from '@angular/core';
import { InMemoryDbService } from 'angular-in-memory-web-api';
import { Bien } from './liste/bien';

@Injectable({
  providedIn: 'root',
})
export class InMemoryDataService implements InMemoryDbService {
  createDb() {
    const biens = [
      { id: 11, titre: 'Appartement F2', descrisption: 'Appartement se situant au Vallon-Dort', images:'data:image/jpeg;base64,', catégories:'appart' },
      { id: 12, titre: 'Maison familial', descrisption: 'Maison pour une grande famille à Koutio', images:'data:image/jpeg;base64,', catégories:'maison' },
      { id: 13, titre: 'Appartement F4', descrisption: 'Appartement a louer', images:'data:image/jpeg;base64,', catégories:'appart'},
      { id: 14, titre: 'Appartement singulier', descrisption: 'Studio Noumea', images:'data:image/jpeg;base64,', catégories:'appart' },
      { id: 15, titre: 'Maison coupe en deux', descrisption: 'Grande maison coupé en deux petite maison', images:'data:image/jpeg;base64,', catégories:'maison' }
    ];
    return {biens};
  }

  // Overrides the genId method to ensure that a hero always has an id.
  // If the heroes array is empty,
  // the method below returns the initial number (11).
  // if the heroes array is not empty, the method below returns the highest
  // hero id + 1.
  genId(biens: Bien[]): number {
    return biens.length > 0 ? Math.max(...biens.map(hero => hero.id)) + 1 : 11;
  }
}